import React from "react";
import SignUp from "./SignUp";
import LogIn from "./LogIn";
import './main.css'

const MainPage = () => {
    return (
        <div>
            <h1 className="textMain">First, before starting, let's Log In or Sign In!</h1>
            <SignUp/>
            <LogIn/>
        </div>
    )
}

export default MainPage;
